Inform the field with the entity's average value of controlled foreign entity equity taking into account the value of an equity interest in, or a debt interest issued by, a controlled entity of the relevant entity only to the extent that the interest is not attributable to any of the following: 
* assets that are held by the controlled entity throughout the relevant period;
* assets attributable to the controlled entity's Australian permanent establishments; 
* other assets that are held by the controlled entity for the purposes of producing assessable income of the controlled entity.
